import React, { Component } from "react";
import Link from "next/link";

const Navbar = () => (
  <nav>
    <div>
      <Link href="/">
        <a>Main</a>
      </Link>
      <Link href="/About">
        <a>About</a>
      </Link>
    </div>
  </nav>
);

export default Navbar;
